import React, { Component } from 'react';
import { Navbar, Nav } from "../../node_modules/react-bootstrap";
import { createBrowserHistory } from '../../node_modules/react-history';
import { Router, Link } from '../../node_modules/react-router-dom';

class Navigation extends Component {
    constructor(props) {
        super(props);
        this.state = {

            page: null
        };

        const history = createBrowserHistory();
    }



    render() {

        return (
            <React.Fragment>
                <Navbar bg="dark" variant="dark">
                    <Navbar.Brand>BOND PRICING</Navbar.Brand>
                    <Router>
                        <Link to={"/valuation"}></Link>
                    </Router>
                    <Nav.Link key="instruction" href="/instruction">Instruction</Nav.Link>

                </Navbar>
            </React.Fragment>
        )
    }
}

export default Navigation;
